    const { xpos, ypos } = props.details;
    //   const xpos = props.details.xpos; #same as above
    //   const ypos = props.details.ypos; #same as above

    console.log(gifUrl)

    return (
        <div
            style={{
                position: 'absolute',
                top: `${ypos}px`,
                left: `${xpos}px`,
                maxWidth: '100px'
            }}
            className="Overlay"
        >
        <img src={`${downloaded_gif/gifUrl}`}/>
        </div>
    );
}

export default ToolTip;
